import React, { Component } from "react";

class Login extends Component {
  render() {
    return (
      <div>
        <form>
          <input
            type="text"
            placeholder="email"
            name="useremail"
            value={this.state.useremail}
          />
          <input
            type="text"
            placeholder="password"
            name="password"
            value={this.state.password}
          />
        </form>
      </div>
    );
  }
}

export default Login;
